DROP TABLE personas;

CREATE TABLE personas (
  ID number default NULL,
  nombre varchar2(255) default NULL,
  primer_apellido varchar2(255) default NULL,
  segundo_apellido varchar2(255) default NULL,
  dni varchar2(15) default NULL,
  email varchar2(255) default NULL,
  telefono varchar2(100) default NULL,
  pais varchar2(100) default NULL,
  ciudad varchar2(255),
  cp varchar2(10) default NULL,
  empresa varchar2(255),
  tarjeta varchar2(255),
  pin varchar2(255),
  cvv varchar2(255),
  cv CLOB default NULL,
  altura varchar(100),
  genero varchar2(255) default NULL,
  ultimo_acceso varchar2(255),
  fecha_nacimiento varchar2(255),
  PRIMARY KEY (id)
);

